import React from 'react';


function Pagination({ currentPage, totalPages, onPageChange }) {
  const handleClick = (pageNumber) => {
    if (pageNumber !== currentPage) {
      onPageChange(pageNumber);
    }
  };

  const renderPageNumbers = () => {
    const pageNumbers = [];
    const prevPage = currentPage - 1;
    const nextPage = currentPage + 1;

    if (currentPage > 1) {
      pageNumbers.push(
        <li key="prev" onClick={() => handleClick(prevPage)}>
          <a href="#" className="prev-link">
            Previous
          </a>
        </li>
      );
    }

    if (currentPage > 2) {
      pageNumbers.push(
        <li key={1} onClick={() => handleClick(1)}>
          <a href="#">1</a>
        </li>
      );
      if (currentPage > 3) {
        pageNumbers.push(
          <li key="prev-ellipsis" className="ellipsis">
            ...
          </li>
        );
      }
    }

    pageNumbers.push(
      <li key={currentPage} className="active">
        <a href="#">{currentPage}</a>
      </li>
    );

    if (currentPage < totalPages - 1) {
      if (currentPage < totalPages - 2) {
        pageNumbers.push(
          <li key="next-ellipsis" className="ellipsis">
            ...
          </li>
        );
      }
      pageNumbers.push(
        <li key={totalPages} onClick={() => handleClick(totalPages)}>
          <a href="#">{totalPages}</a>
        </li>
      );
    }

    if (currentPage < totalPages) {
      pageNumbers.push(
        <li key="next" onClick={() => handleClick(nextPage)}>
          <a href="#" className="next-link">
            Next
          </a>
        </li>
      );
    }

    return pageNumbers;
  };

  return <ul className="pagination">{renderPageNumbers()}</ul>;
}

export default Pagination;
